result:
query {
  products: allOffering(sort: [{ by: "price",  }, { by: "boost" }] order: DESC, filter: { featured: { eq: true }, type: { eq: "product"} }) {
    edges {
      node {
        id
        title
        slug
        date (format: "D. MMMM YYYY")
        timeToRead
        published
        featured
        boost
        type
        description
        cover_image
        path
        tags {
          id
          title
          path
        }
      }
    }
  }
  collections: allCollection( sortBy: "boost", order: DESC, filter: { published: { eq: true }} ) {
    edges {
      node {
        id
        title
        slug
        boost
        date (format: "D. MMMM YYYY")
        timeToRead
        featured
        published
        description
        cover_image
        path
        tags {
          id
          title
          path
        }
        offerings
      }
    }
  }
}
